import { WelcomePage, SpineLayout, TemplateChart,ConanLayout } from './';

export default {
  path: '',
  childRoutes: [{ path: 'census_tract_filter', component: SpineLayout,name:'spine', isIndex: true },
  { path: 'climate_risk', component: ConanLayout, name:'conan'}],
};
